n,k=map(int,input().split())
a=list(map(int,input().split()))
ans=float('inf')

for i in range(0,n-k+1):
  b=a[i]
  c=a[i+k-1]
  if c<=0:
    ans=min(ans,abs(b))
  elif b>=0:
    ans=min(ans,abs(c))
  else:
    ans=min(ans,abs(c)+abs(b)*2,abs(c)*2+abs(b))

print(ans)

8f49f93f-cb77-4c1a-9ee7-ceeca6304545.text:
N, K = list(map(int, input().split()))
X = list(map(int, input().split()))

minus = []
plus = []

for x in X:
    if x < 0:
        minus.append(-x)
    else:
        plus.append(x)

minus.reverse()
ans = float('inf')

for i in range(min(K+1, len(minus)+1)):
    p = K - i
    if i == 0:
        if len(plus) >= p:
            ans = min(ans, plus[K-1])
    elif i == K:
        if len(minus) >= K:
            ans = min(ans, minus[K-1])
    else:
        if len(plus) >= p and len(minus) >= i:
            a = plus[p-1]
            b = minus[i-1]
            if a < b:
                ans = min(ans, 2 * a + b)
            else:
                ans = min(ans, b * 2 + a)

print(ans)
